    background: linear-gradient(180deg, rgba(255, 217, 0, 0.49) 0%, rgba(255, 217, 0, 0.359) 76.25%);

    &__container {
        width: 70%;
        margin: auto;
        padding: 100px 0;
    }

    h1 {
        font-size: 40px;
        max-width: 500px;
        line-height: 134.7%;
        color: #1E202D;
        margin-bottom: 16px;

    }

    h2 {
        font-style: normal;
        font-weight: 300;
        font-size: 22px;
        line-height: 140.7%;
        margin-bottom: 8px;

