        color: #3A3C4E;
        max-width: 480px;
    }

    &__trusted {
        display: flex;
        align-items: center;
        color: #3A3C4E;
        font-weight: 300;
    }

    &__form {
        max-width: 500px;
        margin-top: 32px;

        &__inputs {
            display: flex;
            margin-bottom: 24px;
            justify-content: space-between;

            input {
                padding: 16px;
                font-size: 16px;
                border: 0;
                width: 500px;
                appearance: none;
                margin-right: 16px;
                //border: 2px solid rgba(211, 211, 211, 0.323);
                border-radius: 10px;
                color: $charcoal;



                display: block;
                color: inherit;
                width: 100%;
                font-family: inherit;
                font-weight: inherit;
                border: none;
                border-radius: 0.4rem;
                transition: box-shadow 300ms;
                border: 1px solid grey;

                &::placeholder {
                    color: #B0BEC5;
                }

                &:focus {
                    outline: none;
                    box-shadow: 0.2rem 0.8rem 1.6rem rgba(112, 109, 96, 0.616);
                }

                &:last-child {
                    margin-right: 0;
                }


                &:focus {
                    outline: 0;
                }
            }
        }


